import React from 'react';
import './style.css';

class Body extends React.Component {
  render = ()=>{
    return (
      <div className='body'>
        <p id="about" className='header'>Hello I'm <b>Neil</b></p>
        <p id="about" className='header'>a <b>sophomore</b> at the </p>
        <p id="about" className='header'><b>University of California, Los Angeles (UCLA) </b> </p>



      </div>
    );
  }
}

export default Body;
